import React, { useEffect, useState } from 'react';
import { Link, useNavigate, useLocation } from 'react-router-dom';

const Navbar = () => {
  const token = localStorage.getItem('token');
  const adminToken = localStorage.getItem('adminToken');
  const navigate = useNavigate();
  const location = useLocation();
  const [theme, setTheme] = useState("dark");

  useEffect(() => {
    document.documentElement.setAttribute("data-theme", theme);
  }, [theme]);

  const handleLogout = () => {
    localStorage.clear();
    alert('Logged out');
    navigate('/login');
  };

  const isActive = (path) => location.pathname === path;

  return (
    <nav style={{
      position: "relative",
      padding: "12px 24px",
      backgroundColor: theme === "dark" ? "#000" : "#f0f0f0",
      borderBottom: theme === "dark" ? "1px solid #00ffff" : "1px solid #333",
      boxShadow: theme === "dark" ? "0 0 10px #00ffff" : "0 0 6px #aaa",
      display: "flex",
      justifyContent: "space-between",
      alignItems: "center",
      fontFamily: "'Orbitron', sans-serif",
      zIndex: 10
    }}>
      <div style={{
        color: theme === "dark" ? "#00ffff" : "#333",
        fontSize: "20px",
        textShadow: theme === "dark" ? "0 0 6px #00ffff" : "none"
      }}>
        📚 Library System
      </div>

      <div style={{ display: "flex", gap: "20px", alignItems: "center" }}>
        <NavItem to="/" label="🏠 Home" active={isActive("/")} theme={theme} />
        <NavItem to="/booklist" label="📖 Books" active={isActive("/booklist")} theme={theme} />

        {adminToken ? (
          <>
            <NavItem to="/admin-dashboard" label="🛠 Admin" active={isActive("/admin-dashboard")} theme={theme} />
            <button onClick={handleLogout} style={buttonStyle(theme)}>🚪 Logout</button>
          </>
        ) : token ? (
          <>
            <NavItem to="/user" label="👤 Profile" active={isActive("/user")} theme={theme} />
            <button onClick={handleLogout} style={buttonStyle(theme)}>🚪 Logout</button>
          </>
        ) : (
          <>
            <NavItem to="/login" label="🔐 Login" active={isActive("/login")} theme={theme} />
            <NavItem to="/register" label="📝 Register" active={isActive("/register")} theme={theme} />
            <NavItem to="/admin-login" label="🛠 Admin Login" active={isActive("/admin-login")} theme={theme} />
          </>
        )}

        {/* 🌙 / ☀️ Theme Toggle */}
        <button onClick={() => setTheme(theme === "dark" ? "light" : "dark")} style={{
          background: "transparent",
          border: "1px solid",
          borderColor: theme === "dark" ? "#00ffff" : "#333",
          color: theme === "dark" ? "#00ffff" : "#333",
          padding: "6px 10px",
          borderRadius: "4px",
          cursor: "pointer",
          fontSize: "13px",
          boxShadow: theme === "dark" ? "0 0 6px #00ffff" : "0 0 4px #aaa"
        }}>
          {theme === "dark" ? "☀️ Light" : "🌙 Dark"}
        </button>
      </div>
    </nav>
  );
};

const NavItem = ({ to, label, active, theme }) => (
  <Link to={to} style={{
    position: "relative",
    color: theme === "dark" ? "#00ffff" : "#333",
    textDecoration: "none",
    fontSize: "14px",
    paddingBottom: "4px",
    textShadow: theme === "dark" ? "0 0 4px #00ffff" : "none",
    borderBottom: active ? `2px solid ${theme === "dark" ? "#00ffff" : "#333"}` : "2px solid transparent",
    transition: "border-bottom 0.3s ease"
  }}>
    {label}
  </Link>
);

const buttonStyle = (theme) => ({
  background: "transparent",
  border: "1px solid",
  borderColor: theme === "dark" ? "#00ffff" : "#333",
  color: theme === "dark" ? "#00ffff" : "#333",
  padding: "6px 12px",
  borderRadius: "4px",
  cursor: "pointer",
  fontSize: "13px",
  boxShadow: theme === "dark" ? "0 0 6px #00ffff" : "0 0 4px #aaa",
  textShadow: theme === "dark" ? "0 0 4px #00ffff" : "none"
});

export default Navbar;
